import './Navbar.css';
import botao from './botao.png';

function NavBar() {
  return (
    <div className="Navbar">
      <h3>GAME</h3>
      <button type="button">
      <img src={botao} alt="Turn on/off symbol" width="18" height="16"/>
      </button>
    </div>
  );
}

export default NavBar;
